function scheduleBend( line, data, bend, unhigh, timeout ) {
	setTimeout(function(){
		$( $('#editor').children()[1] ).scrollTop( line );
		$('#textmirror-wrap').scrollTop( line );
		var newTxt = $('#textmirror').html().replace(data,bend);
		$('#textmirror').html( newTxt );
		$( $('#editor').children()[1] ).val( $('#textmirror').text() );
		saveEditor();
		setTimeout(function(){
			var newTxt = $('#textmirror').html().replace(bend,unhigh);
			$('#textmirror').html( newTxt );
		},400);
	},timeout);
}


function databend(  ){
	// $('#canvas').css('left',window.innerWidth*0.5+"px");
	$( $('#bg').children()[2] ).click();
	$('#editor').fadeIn();

	var txtArea = $( $('#editor').children()[1] );
	var txtMir = $('#textmirror');
	// hide txtArea + replace w/ mirror div
	$('#textmirror-wrap').css('height', txtArea.height()+10+"px");
	$('#textmirror-wrap').css('overflow-y','scroll');
	txtArea.css('opacity',0);
	txtMir.text( txtArea.val() );
	
	for (var i = 0; i < bends.length; i++) {
		scheduleBend( bends[i].line, bends[i].original, bends[i].bend, bends[i].unhigh, (i+1)*500 );
	};

	setTimeout(function(){
		//return to editor
		$('#textmirror-wrap').css('display','none');
		txtArea.css('opacity',1);
	},500*(bends.length+2));
}